import { Container } from '@mui/material'
import React from 'react'

export default function Footer() {
  return (
    <>
    <Container maxWidth={'lg'} style={{
    display: "flex",
    justifyContent: "center",
    alignItems: "center",
    backgroundColor: "blue"
  }}>
      <h4>Derechos Reservados 2022</h4>
    </Container>
    </>
  )
}
